//获取每一个科目的标题和星级组成的字符串，
var textArr = new Array();
g5.getText = function(rowIndex, text){

    var i;
    for (i=0; i<15; i++){
        if(i == rowIndex){
            textArr[i] = text; 
            console.log("i;t="+i+"-》"+textArr[i]);
        }
    }
}  

//获取所有科目的星级 组成g5.sendText;
g5.getTextAll = function (){
    g5.sendText ="";
    var i;
    for (i=0;i<textArr.length;i++){
        if (textArr[i]!=null){
           g5.sendText += textArr[i];
        }
         //g5.sendText += textArr[i];
    }
}



//陪驾历史处理

g5.setCell = function (cell, text1, text2, text3, text4, text5, text6, text7) {  
    console.log("t1="+text1+" t2="+text2+" t3="+text3+" t4="+text4+" t5="+text5+" t6="+text6) 
    console.log(cell);
    if (ee.getText(cell.eeChildren[0].eeChildren[0]) != text1) {
        ee.setText(cell.eeChildren[0].eeChildren[0], text1);
    } 
    if (ee.getText(cell.eeChildren[0].eeChildren[1]) != text2) {
        ee.setText(cell.eeChildren[0].eeChildren[1], text2);
    }    
    if (ee.getText(cell.eeChildren[0].eeChildren[2]) != text3) {
        ee.setText(cell.eeChildren[0].eeChildren[2], text3);
    }    
    if (ee.getText(cell.eeChildren[0].eeChildren[3]) != text4) {
        ee.setText(cell.eeChildren[0].eeChildren[3], text4);
    }    
    if (ee.getText(cell.eeChildren[0].eeChildren[4]) != text5) {
        ee.setText(cell.eeChildren[0].eeChildren[4], text5);
    }    
    if (ee.getText(cell.eeChildren[0].eeChildren[5]) != text6) {
        ee.setText(cell.eeChildren[0].eeChildren[5], text6);
    }  
   // console.log("text7="+text7) ; 

   if(text5 == '<span style="color:#ffad59">已完成<span>'){
       ee.setImage(cell.eeChildren[0].eeChildren[7], "/App1PJ/test/cval/shenglveY.png", "fill");
   }else {
       ee.setImage(cell.eeChildren[0].eeChildren[7], "/App1PJ/test/cval/shenglveG.png", "fill");
   }

    var index = text7.indexOf(":");
    var project = text7.substr(0,index);
    var star =text7.substr(index+1,1);  
    console.log("p->"+project+"| s->"+star);
    if (ee.getText(cell.eeChildren[0].eeChildren[2].eeChildren[0]) != project) {
        ee.setText(cell.eeChildren[0].eeChildren[2].eeChildren[0], project);
    }
    if(star ==3){
        ee.setImage(cell.eeChildren[0].eeChildren[2].eeChildren[1], "/App1PJ/test/cval/star1.png", "fill");
        ee.setImage(cell.eeChildren[0].eeChildren[2].eeChildren[2], "/App1PJ/test/cval/star2.png", "fill");
        ee.setImage(cell.eeChildren[0].eeChildren[2].eeChildren[3], "/App1PJ/test/cval/star3.png", "fill");
    }else if(star ==2){
        ee.setImage(cell.eeChildren[0].eeChildren[2].eeChildren[1], "/App1PJ/test/cval/star1.png", "fill");
        ee.setImage(cell.eeChildren[0].eeChildren[2].eeChildren[2], "/App1PJ/test/cval/star2.png", "fill");
    }else if(star ==1){
        ee.setImage(cell.eeChildren[0].eeChildren[2].eeChildren[1], "/App1PJ/test/cval/star1.png", "fill");
    }



}

g5.taskRefresh = function() { 
    getHistory(); 
    var i, cell;
    /*
    if (eb.isEmpty(g5.taskH)) {
        for (i=0; i<3; i++) {
            cell = ee.getTableCell(ee.getControl("tablebody2"), 0, i);
            g5.setCell(cell, "", "", "", "", "", "");
        }
        setTimeout(g5.taskRefresh, 100);
        return;
    } */

    //var text1 = "", text2 = "", text3 = "", text4 = "", text5 = "", text6 = "";
    var status;
    // alert("count="+g5.rowCountH);
    for(i=0;i< g5.rowCountH; i++){ 
     var text1 = "", text2 = "", text3 = "", text4 = "", text5 = "", text6 = "", text7="";
        cell = ee.getTableCell(ee.getControl("tablebody2"), 0, i);
        var dateTime = g5.taskH[2][i];
        var index = dateTime.indexOf(" ");
        var date = dateTime.substr(0,index);            
        var time = dateTime.substring(index+1); 
        var remark = g5.taskH[4][i]; 
        var address = g5.taskH[0][i];
        var assess = g5.taskH[3][i];
        if(remark.length > 9){
          remark = remark.substr(0,8) +"...";  
        } 
        if(address.length >7){
          address = address.substr(0,8)+"...";
        }
       // alert(date);alert(time);
        text1 += "陪驾地址: "+address;
        text2 += "课时: "+g5.taskH[1][i]+" 小时"+"  "+time;
        text3 += "陪驾详情:"; //shijian 
        text4 += "教练留言:"+remark;
        //text5 += "已完成"; 
        if(assess ==""){
           text5 += '<span style="color:#ffad59">未评价<span>';  
        }else {
           text5 += '<span style="color:#ffad59">已完成<span>';
        }

        text6 += date; 
        //alert(assess);
        var index1 = assess.indexOf(";");
        text7 = assess.substr(0,index1);
       // alert(text7)


        g5.setCell(cell,text1,text2,text3,text4,text5,text6,text7);

    }        
    setTimeout(g5.taskRefresh, 1000);
}  

 g5.taskRefresh(); 

g5.taskClick = function (y) {
    //var cell = ee.getTableCell(ee.getControl("tablebody2"), 0, y); 
    //获取到记录的行号，重新从 g5.taskH 中获取数据  
    var cell = ee.getControl("layoutyitem4");
    var i =y;
    var text1 = "", text2 = "", text3 = "", text4 = "", text5 = "", text6 = "", text7="", text8="";
        var dateTime = g5.taskH[2][i];
        var index = dateTime.indexOf(" ");
        var date = dateTime.substr(0,index);            
        var time = dateTime.substring(index+1); 
        var remark = g5.taskH[4][i]; 
        var address = g5.taskH[0][i];
        var assess = g5.taskH[3][i];
        var coachName = g5.taskH[5][i];

        if(address.length >7){
          address = address.substr(0,8)+"...";
        }
       // alert(date);alert(time);
        text1 += "陪驾地址: "+address;
        text2 += "课时: "+g5.taskH[1][i]+" 小时"+"  "+time;
        text3 += "教练员: "+ coachName;
        text4 += "陪练次数:  "+"2"; // 陪练次数未完成
        text5 += date;
        text6 += "陪练课时: "+g5.taskH[1][i]; 
        text7 += assess;
        text8 += remark;
        //text5 += "已完成"; 

        g5.setDetail(cell,text1,text2,text3,text4,text5,text6,text7,text8); 
        ee.showAni(ee.getControl("panel40"));
        ee.setVisible(ee.getControl("panel19"),true);     



}

g5.setDetail = function(cell,text1,text2,text3,text4,text5,text6,text7,text8){
    console.log("detail :: t1="+text1+" t2="+text2+" t3="+text3+" t4="+text4+" t5="+text5+" t6="+text6+" t7="+text7+" t8="+text8);

     if (ee.getText(cell.eeChildren[2]) != text1) {
        ee.setText(cell.eeChildren[2], text1);
     } 
     if (ee.getText(cell.eeChildren[3]) != text2) {
        ee.setText(cell.eeChildren[3], text2);
     } 
     if (ee.getText(cell.eeChildren[4]) != text3) {
        ee.setText(cell.eeChildren[4], text3);
     } 
     if (ee.getText(cell.eeChildren[5]) != text4) {
        ee.setText(cell.eeChildren[5], text4);
     } 
     if (ee.getText(cell.eeChildren[6]) != text5) {
        ee.setText(cell.eeChildren[6], text5);
     } 
     if (ee.getText(cell.eeChildren[7]) != text6) {
        ee.setText(cell.eeChildren[7], text6);
     } 

     //留言
     if (ee.getText(cell.parentNode.eeChildren[5].eeChildren[2]) != text8) {
        ee.setText(cell.parentNode.eeChildren[5].eeChildren[2], text8);
     }

}

